class Solution {
public:
    void wallsAndGates(vector<vector<int>>& rooms) {
        if (rooms.empty() || rooms[0].empty()) return;
        
        int m = rooms.size();
        int n = rooms[0].size();
        vector<int> v(n, 0);
        vector<vector<int>> visited(m, v);
        queue<pair<int, int>> q;
        
        for (int i = 0; i < m; ++i)
        {
            for (int j = 0; j < n; ++j)
            {
                if (rooms[i][j] != 0) continue;
                q.push({i,j});
            }
        }
        
        int dist = 0;
        while (!q.empty())
        {
            int k = q.size();
            for (int l = 0; l < k; ++l)
            {
                pair<int, int> cur = q.front();
                q.pop();

                for (int p = 0; p < 4; ++p)
                {
                    int nextx = cur.second + xdir[p];
                    int nexty = cur.first + ydir[p];

                    if (nextx >= 0 && nextx < n && nexty >= 0 && nexty < m && !visited[nexty][nextx] && rooms[nexty][nextx] != -1)
                    {
                        rooms[nexty][nextx] = min(dist+1, rooms[nexty][nextx]);
                        q.push({nexty, nextx});
                        visited[nexty][nextx] = 1;
                    }
                }
            }
            dist++;
        }        
    }
private:
    int xdir[4] = {0, -1, 0, 1};
    int ydir[4] = {1, 0, -1, 0};
};


